import React from 'react'
import "./Note.css"

function Note(props) {

    function handleClick(){
        props.onDelete(props.id);
    }

    return (
        <div className="note">
            <h1>{props.title}</h1>
            <p>{props.start} - {props.end}</p>
            <span onClick={handleClick}><i class="fas fa-trash-alt"></i></span>
            <hr ckassName="hr" />
        </div>
    )
}

export default Note
